// Carousel
//-------------------------------------//
if (typeof XWiki == "undefined") {
  var XWiki = {}; 
}

Object.extend(XWiki, {
  carouselWidget: {

    slider: null,

    /*
    ** Initialize carousel widget.
    */
    init : function() {
      if($('carousel')){
        this.slider = new Glider('carousel', {duration:0.5, initialSection: 'section1', autoGlide:false}); 
        this.initOnClickSlider();
        this.startAutoSlider();
      }
    },
    initOnClickSlider: function(){
      $$('.section').each(function(section){
        this.initOnClickSliding(section);
        if(isIE7())
          section.addClassName('carousel-hide');
      }.bind(this));
      if(isIE7())
        $('section1').removeClassName('carousel-hide');
    },
    initOnClickSliding: function(section){
      var sectionIndex = section.down().className;
      var sectionBullet = $('slide-' + sectionIndex);
      sectionBullet.observe('click', function(event){
        if(isIE7())
          this.getCurrentSection().addClassName('carousel-hide');
        this.slider.moveTo(this.slider.sections[sectionIndex], this.slider.scroller, { 
          duration: this.slider.options.duration
        });
        this.enableBullet(sectionBullet);
        if(isIE7())
          section.removeClassName('carousel-hide');
      }.bind(this));
    },
    enableBullet: function(sectionBullet){
      $('slider-navigation').select('.bullet.on').each(function(bullet){
        bullet.removeClassName('on');
      })
      sectionBullet.addClassName('on');
    }
    ,
    enableBulletOnAutoSliding: function(section){
      var sectionIndex = section.down().className;
      var sectionBullet = $('slide-' + sectionIndex);
      this.enableBullet(sectionBullet);
    },
    startAutoSlider: function(){
      $('carousel').down('.scroller').observe('mouseover', function(event){
        $('carousel').addClassName('mouseover');
      });
      $('carousel').down('.scroller').observe('mouseout', function(event){
        $('carousel').removeClassName('mouseover');
      });
      $('slider-navigation').select('div').each(function(bullet){
        bullet.observe('mouseover', function(event){
          $('carousel').addClassName('mouseover');
        });
        bullet.observe('mouseout', function(event){
          $('carousel').removeClassName('mouseover');
        });
      });
      this.slide();
    },
    slide: function(){
      var slide = arguments[0];
      if(slide && !$('carousel').hasClassName('mouseover')){
        if(isIE7())
          this.getCurrentSection().addClassName('carousel-hide');
        this.slider.next();
        var currentSection = this.getCurrentSection();
        if(isIE7())
          this.getCurrentSection().removeClassName('carousel-hide');
        this.enableBulletOnAutoSliding(currentSection);
      }
      t=setTimeout(this.slide.bind(this, true), 7000);
    },
    getCurrentSection: function(){
      return this.slider.current;
    }
  }
});

Event.observe(document, 'xwiki:dom:loaded', function() {
  XWiki.carouselWidget.init(); 
})

